import './App.css';
import { LoginSignup } from './pages/LoginSignup/LoginSignup';
import Header from './pages/Home/Header';
import Feature from './pages/Home/Feature';
import About from './pages/Home/About';
import Presentation from './pages/Home/Presentation';
import aboutimage from './assFrame 19.png';
import aboutimage1 from './components/pages/images/download.png';


function App() {
  return (
    <div className="App">
      <LoginSignup/>
      <Header/>
      <Feature/>
      <About image={aboutimage} title='Comes with' button='Get the App' />
      <Presentation />
      <About image={aboutimage1} title='Download the app' button='Download' />
    </div>
  );
}

export default App;
